DELIMITER //
CREATE TRIGGER `controllo_eta_e_password` BEFORE INSERT ON `persone`
 FOR EACH ROW BEGIN
	IF (DATEDIFF(NOW(),NEW.dataDiNascita)<6570) THEN
		insert into Error(error_id, error_type)
		values ("1001","Utente minorenne ha cercato di registrarsi!");
	END IF;
	IF (LENGTH(NEW.Psw)<8) THEN
		insert into Error(error_id, error_type)
		values ("1002","Password troppo corta! (almeno 8 caratteri)");
	END IF;
END
